const body = document.querySelector(".main");
const input = document.querySelector(".input")

let filteredList = teacher


input.addEventListener("input" , (e)=>{ 
    const ele = document.querySelectorAll(".profile")
    ele.forEach(e=>{
        e.remove();
    })

    filteredList = teacher.filter(ind=>{
        if(ind.title.toLowerCase().includes(e.target.value.toLowerCase())){
            return ind;
        }
    })

    console.log(filteredList)
    renderList()
})

const renderList = () => {
    filteredList.forEach(ind=>{

        let list = document.createElement("div")
        list.classList.add("profile");

        let div1 = document.createElement("div")
        div1.classList.add("heading")

        
        let div3 = document.createElement("div")
        div3.classList.add("pic")
        let img = document.createElement("img");
        img.classList.add("profilepic")
        img.src = `https://smu.edu.in${ind.thumbnailImagePath}`
        div3.appendChild(img)

        let div4 = document.createElement("div")
        div4.classList.add("teachername")

        let name = document.createElement("h4");
        name.classList.add("name")
        name.innerHTML = ind.title.toUpperCase();
        
        let designation = document.createElement("p");
        designation.classList.add("designation");
        designation.innerHTML = ind.designation;
        
        div4.appendChild(name)
        div4.appendChild(designation)


        let div2 = document.createElement("div")
        div2.classList.add("divbody")

        let email = document.createElement("p");
        email.classList.add("email")
        email.innerHTML = `Email :  ${ind.email}`;
        
        let department = document.createElement("p");
        department.classList.add("department")
        department.innerHTML = ind.instituteText;

        let phone = document.createElement("p");
        phone.classList.add("phone")
        phone.innerHTML = `Phone No : ${ind.phone}`;

        div2.appendChild(department)
        div2.appendChild(phone)
        div2.appendChild(email)


        div1.appendChild(div3)
        div1.appendChild(div4)

        list.appendChild(div1)
        list.appendChild(div2)

        body.appendChild(list);
    })
}

renderList()




